import React from "react"
import {  Form, } from "semantic-ui-react"
export default class GameFilter extends React.Component{
render(){
    return(

        <Form>
          <Form.Group widths="equal">
                <Form.Field>
                  <label>Search by game name</label>
                  <input sortbyname={this.props.sortbyname}></input>
                </Form.Field>

                <Form.Field>
                  <label>Search by City</label>
                  <input sortbycity={this.props.sortbycity}></input>
                </Form.Field>
          </Form.Group>

        </Form>

    )
}
}
